import React, { Component } from 'react'

export class QuestionAddModal extends Component {
    constructor(props) {
        super(props);

        console.log(this.props);
    }

    render() {
        return (
            <Modal
                size="lg"
                aria-labelledby="contained-modal-title-vcenter"
                centered
                {...props}
            >
                <Modal.Header>
                    <Modal.Title id="contained-modal-title-vcenter">
                        Thêm câu hỏi (câu {numberOfQuest + 1})
                    </Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    
                </Modal.Body>
                <Modal.Footer>
                <Button variant="outline-success" onClick={() => onAddQuestionSubmit}>Thêm</Button>
                </Modal.Footer>
            </Modal>
        )
    }
}

export default QuestionAddModal
